import React, { Fragment, useEffect, useState } from 'react'

const CocktailPage = () => {
  const [cocktail, setCocktail] = useState([])

  const getCocktail = async () => {
    try {
      const response = await fetch("http://localhost:5000/cocktail");
      const jsonData = await response.json();

      setCocktail(jsonData);
    } catch (err) {
      console.error(err.message);
    }
  };

  useEffect(() => {
    getCocktail();
  }, []);

  return (
    <Fragment className="Cocktail Details">
      <h1 className='text-center mt-5'> Cocktail Details </h1>
      <table class="table mt-5 text-center">
        <thead>
          <tr>
            <th>Cocktail</th>
          </tr>
        </thead>
        <tbody>
          {cocktails.map(cocktail =>(
            <tr key={cocktail.id}>
              <td>{cocktail.name}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </Fragment>
  )
}

export default CocktailPage;
